import React, { useEffect, useState } from 'react';
import { Box, Typography, Paper, Table, TableHead, TableRow, TableCell, TableBody } from '@mui/material';
import api from '../services/api';

export default function Dividen() {
  const [dividenList, setDividenList] = useState([]);

  const fetchDividen = async () => {
    try {
      // Sesuaikan endpoint
      const res = await api.get('/finance/dividens');
      setDividenList(res.data);
    } catch (err) {
      console.error(err);
      alert('Gagal memuat data dividen');
    }
  };

  useEffect(() => {
    fetchDividen();
  }, []);

  return (
    <Box>
      <Typography variant="h5" sx={{ fontWeight: 700, mb: 2 }}>
        Dividen Management
      </Typography>

      <Paper sx={{ p: 2 }}>
        <Table>
          <TableHead>
            <TableRow sx={{ backgroundColor: '#f5f5f5' }}>
              <TableCell>ID</TableCell>
              <TableCell>Tanggal</TableCell>
              <TableCell>Total Profit</TableCell>
              <TableCell>Catatan / Notes</TableCell>
              <TableCell>Status</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {dividenList.map((div) => (
              <TableRow key={div.id}>
                <TableCell>{div.id}</TableCell>
                <TableCell>{new Date(div.distributedAt).toLocaleDateString()}</TableCell>
                <TableCell>{div.totalProfit}</TableCell>
                <TableCell>{div.notes}</TableCell>
                <TableCell>{div.status || 'N/A'}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Paper>
    </Box>
  );
}
